%script 
--Drop any previous models for Notebook repeatability

DECLARE
v_sql varchar2(100);

BEGIN
    v_sql := 'CALL DBMS_DATA_MINING.DROP_MODEL(''DEEP_LEARNING_MODEL'')';
    EXECUTE IMMEDIATE v_sql;
    DBMS_OUTPUT.PUT_LINE (v_sql ||': succeeded');
EXCEPTION
    WHEN OTHERS THEN
    DBMS_OUTPUT.PUT_LINE (v_sql ||': drop unneccessary - no model exists');
END;
/

%script

DECLARE
v_sql varchar2(100);

--drop build settings 
BEGIN
    v_sql := 'DROP TABLE neural_network_settings';
    EXECUTE IMMEDIATE v_sql;
    DBMS_OUTPUT.PUT_LINE (v_sql ||': succeeded');
EXCEPTION
    WHEN OTHERS THEN
    DBMS_OUTPUT.PUT_LINE (v_sql ||': drop unneccessary - no table exists');
END;
/

%script 

DECLARE
v_sql varchar2(100);

--Create a Build Setting for Neural Network Model Build 
BEGIN
    v_sql := 'CREATE TABLE neural_network_settings (SETTING_NAME  VARCHAR2(30),SETTING_VALUE VARCHAR2(4000))';
    EXECUTE IMMEDIATE v_sql;
    DBMS_OUTPUT.PUT_LINE (v_sql ||': succeeded');
EXCEPTION
    WHEN OTHERS THEN
    DBMS_OUTPUT.PUT_LINE (v_sql ||': create failed');
END;
/

%script 
BEGIN       
  INSERT INTO neural_network_settings (
        setting_name,
        setting_value
    ) VALUES (
        dbms_data_mining.prep_auto,
        dbms_data_mining.prep_auto_on
    );
    INSERT INTO neural_network_settings (
        setting_name,
        setting_value
    ) VALUES (
        dbms_data_mining.algo_name,
        dbms_data_mining.algo_neural_network
    );
    INSERT INTO neural_network_settings (
        setting_name,
        setting_value
    ) VALUES (
        dbms_data_mining.nnet_activations,
        '''NNET_ACTIVATIONS_LOG_SIG'',''NNET_ACTIVATIONS_LOG_SIG'',''NNET_ACTIVATIONS_LOG_SIG'''
    );
    INSERT INTO neural_network_settings (
        setting_name,
        setting_value
    ) VALUES (
        dbms_data_mining.nnet_nodes_per_layer,
        '512,250,100'
    );
END;
/

SELECT view_name, view_type FROM user_mining_model_views
  WHERE model_name='DEEP_LEARNING_MODEL'
  ORDER BY view_name;
